import React from 'react';
// import {} from './styles';
// import AppLayout from '../components/AppLayout';
import HomeLayout from '../components/HomeLayout';

const Home = () => (
  <HomeLayout>
    <div className="container">
      <>
        모르겠다 시발 김동진개새끼가 왜 배신감이 든지
      </>
    </div>
  </HomeLayout>
);

export default Home;
